import Navbar from './../Navbar/Navbar';
import Home from './../Home/Home';
import Movie from './../Movie/Movie';
import Tv from './../Tv/Tv';
import People from './../People/People';

export default function App() {
  return (
    <div>
      <Navbar/>
      <Home/>
      <Movie/>
      <Tv/>
      <People/>

    </div>
  )
}
